jQuery.extend(jQuery.roundabout_shape,{theJuggler:function(e,t,n){return{x:Math.sin(e+t),y:Math.tan(Math.exp(Math.log(e))+t)/(n-1),z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},figure8:function(e,t,n){return{x:Math.sin(2*e+t),y:Math.sin(e+Math.PI/2+t)/8*n,z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},waterWheel:function(e,t,n){return{x:Math.sin(e+Math.PI/2+t)/8*n,y:Math.sin(e+t)/(Math.PI/2),z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},square:function(e,t,n){var i,o,a;return Math.PI/2>=e?(i=2/Math.PI*e,o=-(2/Math.PI)*e+1,a=-(1/Math.PI)*e+1):e>Math.PI/2&&Math.PI>=e?(i=-(2/Math.PI)*e+2,o=-(2/Math.PI)*e+1,a=-(1/Math.PI)*e+1):e>Math.PI&&3*Math.PI/2>=e?(i=-(2/Math.PI)*e+2,o=2/Math.PI*e-3,a=1/Math.PI*e-1):(i=2/Math.PI*e-4,o=2/Math.PI*e-3,a=1/Math.PI*e-1),{x:i/1.55,y:o*n,z:a,scale:a}},conveyorBeltLeft:function(e,t,n){return{x:-Math.cos(e+t),y:Math.cos(e+3*Math.PI/2+t)/8*n,z:(Math.sin(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},conveyorBeltRight:function(e,t,n){return{x:Math.cos(e+t),y:Math.cos(e+3*Math.PI/2+t)/8*n,z:(Math.sin(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},goodbyeCruelWorld:function(e,t,n){return{x:Math.sin(e+t),y:Math.tan(e+3*Math.PI/2+t)/8*(n+.5),z:(Math.sin(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},diagonalRingLeft:function(e,t,n){return{x:Math.sin(e+t),y:-Math.cos(e+Math.tan(Math.cos(t)))/(n+1.5),z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},diagonalRingRight:function(e,t,n){return{x:Math.sin(e+t),y:Math.cos(e+Math.tan(Math.cos(t)))/(n+1.5),z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},rollerCoaster:function(e,t,n){return{x:Math.sin(e+t),y:Math.sin((2+n)*e),z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}},tearDrop:function(e,t,n){return{x:Math.sin(e+t),y:-Math.sin(e/2+n)+.35,z:(Math.cos(e+t)+1)/2,scale:Math.sin(e+Math.PI/2+t)/2+.5}}});
